import { START_INDEX } from '../constants/index'

const defaultState = {
    startIndex : 0
}

const Search = ( state = defaultState, action) =>{
    const { type, data } = action
    console.log( type )
    switch( type ){
        case START_INDEX:
            return { startIndex: data.startIndex }
        default:
            return state
    }
}

export default Search
